import React from 'react'
import { useSelector } from "react-redux";
import Cards from './Cards'

const List = () => {
  const events = useSelector((state) => state.eventReducer.s);
  return (
    <div><div style={{display:"flex",justifyContent:"space-evenly",flexWrap:"wrap",margin:"20px"}}>
    {events.map((el) => (
      <Cards el={el} key={el._id} />
    ))}
  </div></div>
  )
}

export default List
